import React, { Component } from 'react'
import './PaletteFooter.css'

class PaletteFooter extends Component{
    render(){
        return(
            <footer className="PaletteFooter">
                <h5>{this.props.paletteName}</h5>
            </footer>
        )
    }
}

export default PaletteFooter;
